import React from "react";
import SongList2 from "./SongList2"
import Song from "../data/songs.json";

class SongList extends React.Component {
  render() {
    return (
      <div>
        <h3>Opdracht 1</h3>
        <table>
          <thead>
            <tr>
              <th>Index</th>
              <th>Artist</th>
              <th>Title</th>
            </tr>
          </thead>
          {
          Song.filter(song => song.artist.includes("")).filter(song => song.title.includes("")).map((Song, index) => {
            return (
              <SongList2 key={index} song={Song} index={index}/>
            );
          })
          }
        </table>
      </div>
    );
  }
}

export default SongList;
